import React from "react"

const ImageList = (props) =>{
  console.log(props)
  return(
    <div>
      { props.images.map(({ id, previewURL, tags})=>{
        return(
          <div key={id}>
            <img src={previewURL} alt={tags}/>
            <button>Search</button>
          </div>
        )
      })}
    </div>
  )
}

export default ImageList
